import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Sidebar from './Sidebar';

function BookingList({ bookings = [] }) {
  const [bookingData, setBookingData] = useState(bookings);
  const [editingBooking, setEditingBooking] = useState(null);
  const [formData, setFormData] = useState({
    vehicle: '',
    customer: '',
    startDate: '',
    endDate: '',
  });

  useEffect(() => {
    setBookingData(bookings);
  }, [bookings]);

  // Handle form data change
  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  // Handle form submit for creating or editing a booking
  const handleFormSubmit = async (e) => {
    e.preventDefault();

    if (editingBooking) {
      // Edit booking
      try {
        await axios.put(`http://localhost:5000/api/bookings/${editingBooking._id}`, formData);
        setBookingData(
          bookingData.map((booking) =>
            booking._id === editingBooking._id ? { ...booking, ...formData } : booking
          )
        );
        setEditingBooking(null);
      } catch (error) {
        console.error('Error updating booking', error);
      }
    } else {
      // Add new booking
      try {
        const response = await axios.post('http://localhost:5000/api/bookings', formData);
        setBookingData([...bookingData, response.data]);
      } catch (error) {
        console.error('Error adding booking', error);
      }
    }

    setFormData({ vehicle: '', customer: '', startDate: '', endDate: '' }); // Clear form after submit
  };

  // Handle Delete
  const handleDelete = async (bookingId) => {
    try {
      await axios.delete(`http://localhost:5000/api/bookings/${bookingId}`);
      setBookingData(bookingData.filter((booking) => booking._id !== bookingId));
    } catch (error) {
      console.error('Error deleting booking', error);
    }
  };

  // Handle Edit
  const handleEdit = (booking) => {
    setEditingBooking(booking);
    setFormData({
      vehicle: booking.vehicle,
      customer: booking.customer,
      startDate: booking.startDate,
      endDate: booking.endDate,
    });
  };

  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="main-content">
        <h2>Bookings</h2>

        {/* Booking Form for Add/Edit */}
        <form onSubmit={handleFormSubmit} className="booking-form">
          <input
            type="text"
            name="vehicle"
            placeholder="Vehicle"
            value={formData.vehicle}
            onChange={handleInputChange}
            required
          />
          <input
            type="text"
            name="customer"
            placeholder="Customer"
            value={formData.customer}
            onChange={handleInputChange}
            required
          />
          <input
            type="date"
            name="startDate"
            placeholder="Start Date"
            value={formData.startDate}
            onChange={handleInputChange}
            required
          />
          <input
            type="date"
            name="endDate"
            placeholder="End Date"
            value={formData.endDate}
            onChange={handleInputChange}
            required
          />
          <button type="submit">{editingBooking ? 'Update Booking' : 'Add Booking'}</button>
        </form>

        {/* Table for Bookings */}
        <div className="table-container">
          <table>
            <thead>
              <tr>
                <th>Vehicle</th>
                <th>Customer</th>
                <th>Start Date</th>
                <th>End Date</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {bookingData.length > 0 ? (
                bookingData.map((booking) => (
                  <tr key={booking._id}>
                    <td>{booking.vehicle}</td>
                    <td>{booking.customer}</td>
                    <td>{booking.startDate}</td>
                    <td>{booking.endDate}</td>
                    <td>
                      <button onClick={() => handleEdit(booking)}>Edit</button>
                      <button onClick={() => handleDelete(booking._id)}>Delete</button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5">No bookings found</td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default BookingList;
